import { StyleSheet } from "react-native";
import { COLORS, FONT } from "../../../../constants";

const styles = StyleSheet.create({
  headerRightContainer: {
    marginRight: 10,
    marginTop: 15,
  },
  headerStyle: {
    marginTop: 10,
    fontSize: 40,
  },
});

export default styles;
